import React from "react";

const Features = () => {
  return (
      <div className="features">
          <div className="fea"></div>
      <h1>מקסמו את פוטנציאל המכירה</h1>
      <h2>ניהול לידים</h2>
      <p>
        נהלו את הפניות עם Skyz CRM באפקטיביות מכניסתם למערכת ועד הפיכתם
        להזדמנויות מכירה ממשיות. בצעו אופטימיזציה ללידים נכנסים. סייעו לאנשי
        המכירות שלכם להתרכז בטיפול בפניות פוטנציאליות בלבד. קבלו תובנות על
        מקורות ההגעה של הפניות, כדי למקסם את החזר ההשקעה.
      </p>
      <button>לימדו עוד</button>
    </div>
  );
};

export default Features;
